CREATE TABLE points (
  id INTEGER PRIMARY KEY AUTOINCREMENT,
  user_id INTEGER NOT NULL,
  amount INTEGER NOT NULL,  
  balance INTEGER NOT NULL,  
  type TEXT NOT NULL CHECK(type IN ('earn', 'withdraw', 'adjust')),  
  source TEXT NOT NULL CHECK(source IN ('campaign', 'bonus', 'withdrawal', 'admin')),  
