);
CREATE TABLE campaigns (
  id INTEGER PRIMARY KEY AUTOINCREMENT,
  advertiser_id INTEGER NOT NULL,
  title TEXT NOT NULL,
  description TEXT,
  product_name TEXT,
  product_url TEXT,
  requirements TEXT,
  budget INTEGER,
  slots INTEGER DEFAULT 1,
  start_date DATE,
  end_date DATE,
  
