  thumbnail_image TEXT,
  
  status TEXT NOT NULL DEFAULT 'pending' CHECK(status IN ('pending', 'recruiting', 'in_progress', 'suspended', 'completed', 'cancelled')),
  created_at DATETIME DEFAULT CURRENT_TIMESTAMP,
  updated_at DATETIME DEFAULT CURRENT_TIMESTAMP, application_start_date DATE, application_end_date DATE, announcement_date DATE, content_start_date DATE, content_end_date DATE, result_announcement_date DATE, provided_items TEXT, mission TEXT, keywords TEXT, notes TEXT, payment_status TEXT DEFAULT 'unpaid' CHECK(payment_status IN ('unpaid', 'paid')), refundable INTEGER DEFAULT 1, point_reward INTEGER DEFAULT 0, smartstore_product_url TEXT, pricing_type TEXT DEFAULT 'product_only', product_value INTEGER DEFAULT 0, sphere_points INTEGER DEFAULT 0, is_best INTEGER DEFAULT 0,
  FOREIGN KEY (advertiser_id) REFERENCES users(id) ON DELETE CASCADE
);
INSERT INTO "campaigns" VALUES(1,3,'[라브] 튀르키예 프리미엄 하이볼 유리잔 (6P) (랜덤제공)','예쁜 하이볼 잔입니다.','하이볼 6P 세트',NULL,'최소 팔로워 2000',120000,10,NULL,NULL,'instagram','@smee96',NULL,NULL,'data:image/jpeg;base64,','completed','2025-11-10T15:59:01.042Z','2025-11-16T04:18:30.377Z','2024-11-14','2024-11-15','2024-11-15',NULL,NULL,'2024-11-15','제품 1 세트',replace('제품 컷 3장 이상 필수 연출 (가능하신 리뷰어 분들만 신청)\n지친 하루를 달래줄 시원한 하이볼 홈술&홈텐딩으로 딱이라는 점을 강조해주세요\n디자인이 깔끔하며 내구성이 좋다는 점 강조해주세요\nhttps://checknbuy.co.kr/ 구매 링크를 추가해주세요','\n',char(10)),'#하이볼잔, #하이볼글라스, #유리컵, #라브, #글라스',replace('1. 제공받은 제품은 타인에게 양도 및 판매, 교환이 불가능 하며 적발 시 제품 가격 환불 및 캠페인 참여가 제한됩니다.\n\n2. 리뷰 콘텐츠 등록 기간 내 리뷰 콘텐츠 미등록 시 제품 가격에 대하여 비용이 청구됩니다.\n\n3. 선정 후 단순 변심에 의한 제공내역 옵션 및 배송지 변경은 어렵습니다.\n\n4. 안내된 제공 내역과 다르거나, 별도 공지 없이 3일 이상 배송이 진행되지 않을 경우에는 1:1문의로 연락해주세요.\n\n5. 업체측 요청에 따라 리뷰어 선정 인원수가 변경될 수 있습니다.\n\n6. 리뷰 콘텐츠 작성 시 선정 된 리뷰 캠페인의 제품으로만 촬영이 이루어져야 합니다.\n\n7. 작성한 리뷰 콘텐츠는 캠페인 마감일을 기준으로 6개월간 유지되어야 하며, 유지되지 않을 경우 페널티가 부과됩니다.\n\n8. 체험하신 블로거분들의 리뷰 콘텐츠는 업체 홍보로 이용될 수 있습니다.','\n',char(10)),'paid',0,0,NULL,'product_only',0,0,0);
